import './ExpensesFilter.css'

const ExpensesFilter = () => {
    const filterChangerHandler = () => {
        console.log('Hi');
    }
    return (
        <div className="expenses-filter">
            <label>Select Year</label>
            <select className=".expenses-filter__control" onChange={filterChangerHandler}>
                <option>2019</option>
                <option>2020</option>
                <option>2021</option>
                <option>2022</option>
            </select>
        </div>
    );
}

export default ExpensesFilter;
